import { NavbarContainer } from "./NavbarElements";

function index() {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavLogo>Diima</NavLogo>
        </NavbarContainer>
      </Nav>
    </>
  );
}

export default index;
